INSERT INTO `berita` VALUES ('brt613905dcb9ebf', '', '2021-09-11 01:45:00', 'Berita Menarik: Mekanisme Pajak Berbasis Emisi; Tips Mobil Manual', '<div data-key=\"1996583\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"1996583\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Artikel mengenai mekanisme pajak berbasis <a href=\"https://kumparan.com/topic/emisi\" to=\"https://kumparan.com/topic/emisi\" data-key=\"1996586\" class=\"LabelLinkweb__StyledLink-fupmuj-0 kZWIkp components__StyledLink-sc-171r1ki-0 dUURkp\" style=\"cursor: pointer; color: rgb(4, 164, 164); outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0.08);\">emisi</a> untuk mobil baru keluaran Oktober 2021 menjadi <a href=\"https://kumparan.com/topic/berita-menarik\" to=\"https://kumparan.com/topic/berita-menarik\" data-key=\"1996591\" class=\"LabelLinkweb__StyledLink-fupmuj-0 kZWIkp components__StyledLink-sc-171r1ki-0 dUURkp\" style=\"cursor: pointer; color: rgb(4, 164, 164); outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0.08);\">berita menarik</a> kumparanOTO pada Rabu (8/9).</span></div></div></div><div data-key=\"1996596\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-0\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"1996597\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div class=\"Viewweb__StyledView-sc-1ajfkkc-0 ehNVkT\" style=\"margin: auto; max-width: 624px;\"></div></div><div data-key=\"1996598\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"1996598\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Berdasarkan amanat Peraturan Pemerintah Nomor 73 Tahun 2019 dan PP 74 2021, per 16 Oktober 2021 akan berlaku sistem pajak PPnBM mobil baru berdasarkan emisi CO2.</span></div></div></div><div data-key=\"1996601\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-0\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"1996602\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"1996602\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Artikel mengenai menghilangkan kebiasaan penggunaan setengah kopling juga menjadi berita menarik. Serta disusul artikel senjata baru <a href=\"https://kumparan.com/topic/bmw\" to=\"https://kumparan.com/topic/bmw\" data-key=\"1996605\" class=\"LabelLinkweb__StyledLink-fupmuj-0 kZWIkp components__StyledLink-sc-171r1ki-0 dUURkp\" style=\"cursor: pointer; color: rgb(4, 164, 164); outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0.08);\">BMW</a> untuk gempur pasar mobil listrik global.</span></div></div></div>', 'berita-menarik-mekanisme-pajak-berbasis-emisi-tips-mobil-manual', 'kbrt61390424c284e', '2021-09-08 20:50:04', '2021-09-08 20:50:04');
INSERT INTO `berita` VALUES ('brt6139062bbaaea', '', '2021-10-02 06:50:00', '4 Tips Aman Pindah Gigi pada Mobil Matik', '<div data-key=\"2018515\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"2018515\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_last_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Penggunaan <a href=\"https://kumparan.com/topic/mobil-matik\" to=\"https://kumparan.com/topic/mobil-matik\" data-key=\"2018518\" class=\"LabelLinkweb__StyledLink-fupmuj-0 kZWIkp components__StyledLink-sc-171r1ki-0 dUURkp\" style=\"cursor: pointer; color: rgb(4, 164, 164); outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0.08);\">mobil matik</a> terlihat lebih mudah dibanding mobil manual. Salah satunya dalam hal mengatur gigi. Karena tidak ada kopling, perpindahan gigi mobil matik cenderung lebih cepat. Hal itu menjadi salah satu alasan mobil matik lebih banyak digemari, terutama oleh anak muda.</span></div></div></div><div data-key=\"2018523\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-0\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"2018524\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div class=\"Viewweb__StyledView-sc-1ajfkkc-0 ehNVkT\" style=\"margin: auto; max-width: 624px;\"></div></div><div data-key=\"2018525\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"2018525\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Walaupun begitu, ada empat<a href=\"https://kumparan.com/topic/tips\" to=\"https://kumparan.com/topic/tips\" data-key=\"2018528\" class=\"LabelLinkweb__StyledLink-fupmuj-0 kZWIkp components__StyledLink-sc-171r1ki-0 dUURkp\" style=\"cursor: pointer; color: rgb(4, 164, 164); outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0.08);\"> tips</a> yang harus kamu ketahui agar kamu bisa memindahkan gigi mobil matik dengan aman. Hal ini untuk berguna untuk menghindari kerusakan.</span></div></div></div><div data-key=\"2018533\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-0\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"2018534\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"2018534\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC\" style=\"margin-top: 15px; margin-bottom: 15px;\"><h2 class=\"components___StyledH3-uk318z-2 jdzIxi\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 eXDISf\" style=\"-webkit-font-smoothing: antialiased; font-size: 20px; line-height: 30px; font-weight: 700;\">1. Atur Gigi R dan D Sebelum Mobil Mundur dan Maju</span></h2></div></div><div data-key=\"2018537\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"2018537\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Jika ingin memundurkan <a href=\"https://kumparan.com/topic/mobil\" to=\"https://kumparan.com/topic/mobil\" data-key=\"2018540\" class=\"LabelLinkweb__StyledLink-fupmuj-0 kZWIkp components__StyledLink-sc-171r1ki-0 dUURkp\" style=\"cursor: pointer; color: rgb(4, 164, 164); outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0.08);\">mobil</a>, pastikan mobil sudah dalam keadaan berhenti. Injak pedal rem dan pastikan kondisi belakang mobil dalam keadaan aman. Setelah itu, kamu bisa langsung pindah ke gigi R.</span></div></div></div><div data-key=\"2018545\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-1\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"2018546\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"2018546\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Sebaliknya, lakukan hal yang sama ketika ingin memajukan mobil setelah mundur. Injak pedal rem, lihat kondisi depan, dan pindah ke gigi D. Cara tersebut dapat membuat pemakaian <em data-key=\"2018623\">gearbox </em>menjadi lebih baik.</span></div></div></div>', '4-tips-aman-pindah-gigi-pada-mobil-matik', 'kbrt61390424c284e', '2021-09-08 20:51:23', '2021-09-08 20:51:23');
INSERT INTO `berita` VALUES ('brt6139069171984', '', '2021-09-29 01:52:00', 'Jangan Sembarangan, Ini Dua Teknik Main Putar Balik di Jalan Raya', '<div data-key=\"2065473\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"2065473\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_last_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Mengemudikan <a href=\"https://kumparan.com/topic/mobil\" to=\"https://kumparan.com/topic/mobil\" data-key=\"2065476\" class=\"LabelLinkweb__StyledLink-fupmuj-0 kZWIkp components__StyledLink-sc-171r1ki-0 dUURkp\" style=\"cursor: pointer; color: rgb(4, 164, 164); outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0.08);\">mobil</a> di jalan raya, tak cuma jalan maju, mundur, belok kanan dan kiri saja. Tapi juga ada kondisi di mana kita harus melakukan <a href=\"https://kumparan.com/topic/putar-balik\" to=\"https://kumparan.com/topic/putar-balik\" data-key=\"2065481\" class=\"LabelLinkweb__StyledLink-fupmuj-0 kZWIkp components__StyledLink-sc-171r1ki-0 dUURkp\" style=\"cursor: pointer; color: rgb(4, 164, 164); outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0.08);\">putar balik</a>.</span></div></div></div><div data-key=\"2065486\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-0\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"2065487\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div class=\"Viewweb__StyledView-sc-1ajfkkc-0 ehNVkT\" style=\"margin: auto; max-width: 624px;\"></div></div><div data-key=\"2065488\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"2065488\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Ya entah memang rutenya seperti itu, atau harus melakukan putar balik karena salah jalan. Apa saja bisa terjadi tentunya.</span></div></div></div><div data-key=\"2065491\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-0\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"2065492\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"2065492\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Nah soal putar balik kendaraan, Anda tak boleh sembarangan dan ternyata ada dua jenisnya. Namun, sebelum masuk ke tekniknya, ketahui dahulu etika memutar kemudi.</span></div></div></div><div data-key=\"2065495\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-1\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"2065496\" class=\"components__NormalWidth-l308u-0 components__Inset-l308u-3 kdNaUL ezVOGo\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"><div class=\"Viewweb__StyledView-sc-1ajfkkc-0 faMFuS\" style=\"margin-top: 10px; margin-bottom: 10px;\"><a rel=\"nofollow\" class=\"LabelLinkweb__StyledLink-fupmuj-0 kZWIkp Kumparan__IframeLink-sc-1xynzhl-0 blJzaf\" href=\"https://kumparan.com/kumparanoto/jangan-salah-begini-cara-menyalakan-mobil-matik-yang-benar-1wTu3LOiJRV\" style=\"cursor: pointer; color: inherit; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0.08); display: block; position: relative;\"><div class=\"Kumparan__Blocker-sc-1xynzhl-1 jVIxtY\" style=\"position: absolute; height: 106px; width: 624px;\"><br></div></a></div></div></div><div data-key=\"2065499\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"2065499\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Product Planning PT SGMW (Wuling) Motors Indonesia, Danang Wiratmoko menyebut, upayakan jangan sering-sering memutar kemudi sampai mentok, apalagi kasar sampai bunyi jedug.</span></div></div></div><div data-key=\"2065502\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-1\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"2065503\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"2065503\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">\"Dalam posisi steering mentok, tekanan pompa power steering-nya paling besar, nah ada risikonya seal bocor karena tekanannya itu,\" ucapnya.</span></div></div></div><div data-key=\"2065506\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-1\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"2065507\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"2065507\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Nah setelah mengetahui itu, berikut dua jenis teknik melakukan putar balik, ala tim teknis Daihatsu Indonesia.</span></div></div></div>', 'jangan-sembarangan-ini-dua-teknik-main-putar-balik-di-jalan-raya', 'kbrt61390424c284e', '2021-09-08 20:53:05', '2021-09-08 20:53:05');
INSERT INTO `berita` VALUES ('brt613906eb94d32', '', '2021-10-01 06:53:00', 'Astra Motor Kalbar Beri Edukasi Keselamatan Berkendara pada Pelajar', '<div data-key=\"2001494\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"2001494\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_last_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\"><span data-key=\"2001526\" style=\"font-weight: bolder;\">Hi!Pontianak -</span> Astra Motor Kalimantan Barat memberikan edukasi keselamatan berkendara kepada siswa SMK Negeri 1 Simpang Hilir, Selasa, 24 Agustus 2021. Edukasi ini diberikan untuk memberikan pemahaman kepada para pelajar mengenai keselamatan berkendara. </span></div></div></div><div data-key=\"2001499\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-0\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"2001500\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div class=\"Viewweb__StyledView-sc-1ajfkkc-0 ehNVkT\" style=\"margin: auto; max-width: 624px;\"></div></div><div data-key=\"2001501\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"2001501\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Materi edukasi ini disampaikan Prastya Agusta, Instruktur Safety Riding Astra Motor Kalimantan Barat. Banyak keseruan di dalamnya, dari mulai sesi tanya jawab hingga ujian yang menunjukkan pemahaman pelajar mengenai Cari Aman saat berkendara.</span></div></div></div><div data-key=\"2001504\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-1\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"2001505\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"2001505\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Antofany Yusticia Ahmadi, Manager Marketing Astra Motor Kalimantan Barat mengungkapkan, edukasi ini diberikan kepada pelajar agar mereka Cari Aman saat berkendara. Selain itu, mereka juga dikenalkan mengenai jenis-jenis standarisasi helm.</span></div></div></div><div data-key=\"2001508\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-2\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"2001509\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"2001509\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">\"Astra Motor Kalimantan Barat memberikan edukasi safety riding kepada peserta edukasi agar mereka Cari Aman terkait keselamatan berkendara dengan mengenal jenis-jenis standarisasi helm membuat dirinya dan orang lain tetap aman saat berkendara,\" ujarnya dalam keterangan tertulis yang diterima <span data-key=\"2001527\" style=\"font-weight: bolder;\">Hi!Pontianak</span>, Jumat, 27 Agustus 2021.</span></div></div></div><div data-key=\"2001515\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-3\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"2001516\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"2001516\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Astra Motor Kalbar secara rutin memberikan edukasi keselamatan berkendara. Hal ini dilakukan untuk memberikan pandangan luas akan pentingnya keselamatan berkendara. </span></div></div></div><div data-key=\"2001519\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-4\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"2001520\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div class=\"Viewweb__StyledView-sc-1ajfkkc-0 ehNVkT\" style=\"margin: auto; max-width: 624px;\"></div></div><div data-key=\"2001521\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"2001521\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">\"Masih ada di antara mereka menganggap bahwa menggunakan riding gear membuat gerah, susah bergerak hingga tidak keren. Padahal menggunakan riding gear itu aman dan keren,\" ucapnya.</span></div></div></div>', 'astra-motor-kalbar-beri-edukasi-keselamatan-berkendara-pada-pelajar', 'kbrt61390424c284e', '2021-09-08 20:54:35', '2021-09-08 20:54:35');
INSERT INTO `berita` VALUES ('brt6139074d0b920', '', '2021-10-01 05:55:00', 'Mengulik Keseruan Pameran Motor Sport yang Digelar Astra Motor Kalbar', '<div data-key=\"1846406\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"1846406\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\"><span data-key=\"1846434\" style=\"font-weight: bolder;\">Hi!Pontianak -</span> Astra Motor Kalimantan Barat mengadakan pameran motor sport di Sambas. Keseruan event ini diulik saat live streaming di Instagram beberapa waktu lalu.</span></div></div></div><div data-key=\"1846411\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-0\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"1846412\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div class=\"Viewweb__StyledView-sc-1ajfkkc-0 ehNVkT\" style=\"margin: auto; max-width: 624px;\"></div></div><div data-key=\"1846413\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"1846413\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Ngobrol online ini mengupas kegiatan pameran motor sport dari Honda. Banyak direct gift untuk pengunjung yang didapat saat acara itu berlangsung.</span></div></div></div><div data-key=\"1846416\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-1\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"1846417\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"1846417\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Antofany Yusticia Ahmadi, Manager Marketing Astra Motor Kalimantan Barat mengungkapkan, bincang online ini dilakukan dengan tujuan menceritakan keseruan bersama Astra Motor Kalbar.</span></div></div></div><div data-key=\"1846420\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-2\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"1846421\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"1846421\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">\"Program Online Honda Sport Moto Show juga memberikan informasi kepada konsumen bahwa Astra Motor Kalimantan Barat menyelenggarakan pameran Honda Sport Moto Show di Sambas. Konsumen juga dapat menikmati keseruannya dengan mendatangi ke pameran atau bisa juga melalui live IG @honda_kalbar,\" ujarnya dalam keterangan tertulis yang diterima <span data-key=\"1846435\" style=\"font-weight: bolder;\">Hi!Pontianak</span>, Senin, 30 Agustus 2021. </span></div></div></div><div data-key=\"1846427\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-4\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"1846428\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"1846428\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Selain itu, bincang online ini juga memberikan hiburan kepada penonton. \"Ada banyak hadiah yang didapat oleh penonton,\" ucapnya.</span></div></div></div>', 'mengulik-keseruan-pameran-motor-sport-yang-digelar-astra-motor-kalbar', 'kbrt61390424c284e', '2021-09-08 20:56:13', '2021-09-08 20:56:13');
INSERT INTO `berita` VALUES ('brt61395f61c6f6a', '', '2021-09-23 00:11:00', 'Hari Pelanggan Nasional, Astra Motor Bagikan Sembako Ke Ojek Online di Pontianak', '<div data-key=\"12\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"12\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\"><span data-key=\"53\" style=\"font-weight: bolder;\">Hi!Pontianak</span> - Astra Motor Kalimantan Barat selaku Main Dealer sepeda motor Honda untuk wilayah Kalbar menyambut peringatan Hari Pelanggan Nasional 2021 yang diperingati pada tanggal 4 September setiap tahunnya. </span></div></div></div><div data-key=\"17\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-0\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"18\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div class=\"Viewweb__StyledView-sc-1ajfkkc-0 ehNVkT\" style=\"margin: auto; max-width: 624px;\"></div></div><div data-key=\"19\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"19\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Berbagai program pun digelar Astra Motor guna mengapresiasi para pelanggan setianya. Mengusung tema “Satu Hati, Senyum Sehatmu Berarti” beragam program tersebut dapat dinikmati di seluruh jaringan Astra Motor di Kalimantan Barat.</span></div></div></div><div data-key=\"22\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-1\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"23\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"23\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Program khusus yang dapat dinikmati oleh konsumen Honda adalah berupa penggantian ban di AHASS dibebaskan dari biaya jasa pasang, sedangkan konsumen yang melakukan pembelian ban di AHASS tanpa pemasangan di tempat memperoleh diskon sebesar 15%. Konsumen juga akan memperoleh voucher gratis senilai 20% untuk paket servis lengkap. </span></div></div></div><div data-key=\"26\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-1\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"27\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"27\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Program ini bisa dinikmati di 42 AHASS yang tersebar diseluruh Kalimantan Barat yang berlaku sampai dengan akhir September 2021. Astra Motor juga memberikan potongan pembelian sepeda motor Honda untuk type Beat CBS sebesar Rp. 800 ribu. Program ini bisa dinikmati untuk konsumen yang melakukan pembelian sepeda motor Honda melalui aplikasi Motorku X.</span></div></div></div><div data-key=\"30\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-2\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"31\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div class=\"Viewweb__StyledView-sc-1ajfkkc-0 ehNVkT\" style=\"margin: auto; max-width: 624px;\"></div></div><div data-key=\"32\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"32\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Aplikasi Motorku X hadir untuk mempermudah konsumen mengakses katalog sepeda motor dan melakukan pembelian sepeda motor. Selain itu, aplikasi ini juga memudahkan konsumen untuk melakukan pembelian aksesoris, apparel, oli, hingga melakukan booking servis. Motorku X dapat diunduh secara gratis dan tersedia dalam platform Android serta iOS.</span></div></div></div>', 'hari-pelanggan-nasional-astra-motor-bagikan-sembako-ke-ojek-online-di-pontianak', 'kbrt61390424c284e', '2021-09-09 03:12:01', '2021-09-09 03:12:01');
INSERT INTO `berita` VALUES ('brt61395fa7e2eff', '', '2021-09-24 10:15:00', 'Jip Legendaris Mercedes-Benz G-Class Akan Disuntik Tenaga Listrik, Anti Boros', '<div data-key=\"3322605\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"3322605\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_last_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Pameran otomotif IAA Mobility Munich Motor Show 2021 nampaknya benar-benar dimanfaatkan oleh <a href=\"https://kumparan.com/topic/mercedes-benz\" to=\"https://kumparan.com/topic/mercedes-benz\" data-key=\"3322608\" class=\"LabelLinkweb__StyledLink-fupmuj-0 kZWIkp components__StyledLink-sc-171r1ki-0 dUURkp\" style=\"cursor: pointer; color: rgb(4, 164, 164); outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0.08);\">Mercedes-Benz</a>, untuk memperkenalkan berbagai <a href=\"https://kumparan.com/topic/mobil-listrik\" to=\"https://kumparan.com/topic/mobil-listrik\" data-key=\"3322613\" class=\"LabelLinkweb__StyledLink-fupmuj-0 kZWIkp components__StyledLink-sc-171r1ki-0 dUURkp\" style=\"cursor: pointer; color: rgb(4, 164, 164); outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0.08);\">mobil listrik</a> terbarunya.</span></div></div></div><div data-key=\"3322618\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-0\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"3322619\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div class=\"Viewweb__StyledView-sc-1ajfkkc-0 ehNVkT\" style=\"margin: auto; max-width: 624px;\"></div></div><div data-key=\"3322620\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"3322620\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Setelah mobil listrik Mercedes-Benz EQE 350, kini giliran versi konsep dari mobil listrik Mercedes-Benz EQG yang resmi ditampilkan. Ya ini merupakan Mercy G-Class yang dibekali dengan tenaga listrik murni.</span></div></div></div><div data-key=\"3322623\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-0\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"3322624\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"3322624\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Tak hanya sekadar menampilkan desainnya semata, pabrikan yang bermarkas di kota Stuttgart Jerman ini juga memberikan bocoran spesifikasinya serta tak ragu menyebut kalau mobil listrik EQG ini bakal segera diproduksi.</span></div></div></div><div data-key=\"3322627\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-1\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"3322628\" class=\"components__NormalWidth-l308u-0 components__Inset-l308u-3 kdNaUL ezVOGo\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"><div class=\"Viewweb__StyledView-sc-1ajfkkc-0 faMFuS\" style=\"margin-top: 10px; margin-bottom: 10px;\"><a rel=\"nofollow\" class=\"LabelLinkweb__StyledLink-fupmuj-0 kZWIkp Kumparan__IframeLink-sc-1xynzhl-0 blJzaf\" href=\"https://kumparan.com/kumparanoto/mobil-listrik-mercedes-benz-eqe-resmi-diperkenalkan-sekali-cas-bisa-660-km-1wTZZ1UFvcU\" style=\"cursor: pointer; color: inherit; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0.08); display: block; position: relative;\"><div class=\"Kumparan__Blocker-sc-1xynzhl-1 jVIxtY\" style=\"position: absolute; height: 106px; width: 624px;\"></div><br></a></div></div></div><div data-key=\"3322631\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"3322631\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Dari segi tampilannya, jip ikonik ini tetap menampilkan bahasa desain G-Class yang mengotak dan punya dimensi besar. Dikombinasikan dengan gaya desain khas mobil listrik kekinian, membuat mobil tetap terlihat berwibawa dan modern.</span></div></div></div><div data-key=\"3322634\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-1\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"3322635\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"3322635\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Berbagai ciri khas bahasa desain G-Class tetap ditampilkan oleh Mercedes-Benz pada mobil ini. Salah satunya pada tampilan depannya yang tetap menampilkan desain lampu membulat yang dibubuhi dengan DRL LED melingkar.</span></div></div></div>', 'jip-legendaris-mercedes-benz-g-class-akan-disuntik-tenaga-listrik-anti-boros', 'kbrt61390424c284e', '2021-09-09 03:13:11', '2021-09-09 03:13:11');
INSERT INTO `berita` VALUES ('brt61396003aa4c5', '', '2021-10-29 11:16:00', 'Catat, Ini 4 Ruas Jalan di Jakarta yang Akan Ditutup Saat Malam Hari', '<div data-key=\"1570387\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"1570387\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_last_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Ditlantas Polda Metro Jaya menginformasikan akan menerapkan kebijakan <a href=\"https://kumparan.com/topic/crowd-free-night\" to=\"https://kumparan.com/topic/crowd-free-night\" data-key=\"1570390\" class=\"LabelLinkweb__StyledLink-fupmuj-0 kZWIkp components__StyledLink-sc-171r1ki-0 dUURkp\" style=\"cursor: pointer; color: rgb(4, 164, 164); outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0.08);\">Crowd Free Night</a>, atau penutupan pada sejumlah ruas jalan di DKI <a href=\"https://kumparan.com/topic/jakarta\" to=\"https://kumparan.com/topic/jakarta\" data-key=\"1570395\" class=\"LabelLinkweb__StyledLink-fupmuj-0 kZWIkp components__StyledLink-sc-171r1ki-0 dUURkp\" style=\"cursor: pointer; color: rgb(4, 164, 164); outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0.08);\">Jakarta</a> saat malam hari setiap akhir pekan.</span></div></div></div><div data-key=\"1570400\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-0\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"1570401\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div class=\"Viewweb__StyledView-sc-1ajfkkc-0 ehNVkT\" style=\"margin: auto; max-width: 624px;\"></div></div><div data-key=\"1570402\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"1570402\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Diberlakukannya Crowd Free Night ini merupakan tindak lanjut dari mulai maraknya aktivitas masyarakat saat malam hari, khususnya akhir pekan di masa PPKM Level 3.</span></div></div></div><div data-key=\"1570405\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-0\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"1570406\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"1570406\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">“Termasuk juga yang namanya balap liar, kami sudah mapping semuanya, kemarin sudah kami lakukan penindakan tegas, cukup banyak,” jelas Kabid Humas Polda Metro Jaya, Kombes Pol. Yusri Yunus.</span></div></div></div><div data-key=\"1570409\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-1\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"1570410\" class=\"components__NormalWidth-l308u-0 components__Inset-l308u-3 kdNaUL ezVOGo\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"><div class=\"Viewweb__StyledView-sc-1ajfkkc-0 faMFuS\" style=\"margin-top: 10px; margin-bottom: 10px;\"><a rel=\"nofollow\" class=\"LabelLinkweb__StyledLink-fupmuj-0 kZWIkp Kumparan__IframeLink-sc-1xynzhl-0 blJzaf\" href=\"https://kumparan.com/kumparannews/sebelum-crowd-free-night-polisi-filterisasi-selektif-mulai-pukul-22-00-wib-1wTgtP3hohc\" style=\"cursor: pointer; color: inherit; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0.08); display: block; position: relative;\"><div class=\"Kumparan__Blocker-sc-1xynzhl-1 jVIxtY\" style=\"position: absolute; height: 106px; width: 624px;\"><br></div></a></div></div></div><div data-key=\"1570413\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"1570413\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Dalam penerapan Crowd Free Night ini, Dirlantas Polda Metro Jaya, Kombes Pol. Sambodo Purnomo Yogo mengatakan ada 4 ruas jalan utama di DKI Jakarta yang akan ditutup, berikut lokasinya.</span></div></div></div><div data-key=\"1570416\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-1\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"1570417\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><ul data-key=\"1570417\" class=\"components__UL-qivw0q-1 WtPBf\" style=\"margin: 1.5em 0px; font-size: 2rem;\"><div data-key=\"1570418\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px;\"><li data-key=\"1570418\" class=\"components__LI-qivw0q-2 kbdiDs\"><div data-key=\"1570419\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px;\"><div data-key=\"1570419\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__Styled