INSERT INTO `berita` VALUES ('brt613960364373f', '', '2021-09-23 01:15:00', 'Astra Motor Kalbar Berikan Kemudahan Layanan dengan Aplikasi Motorku X', '<div data-key=\"3205493\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"3205493\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_last_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\"> Astra Motor Kalimantan Barat memberikan kemudahan layanan kepada konsumen lewat aplikasi Motorku X. Motorku X menjadi solusi praktis dan anti ribet yang bisa digunakan para konsumen.</span></div></div></div><div data-key=\"3205498\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-0\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"3205499\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div class=\"Viewweb__StyledView-sc-1ajfkkc-0 ehNVkT\" style=\"margin: auto; max-width: 624px;\"></div></div><div data-key=\"3205500\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"3205500\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Marketing Manager Astra Motor Kalimantan Barat, Antofany Yusticia Ahmady mengatakan, Astra Motor Kalbar menawarkan kemudahan seiring dengan berkembangnya teknologi. </span></div></div></div><div data-key=\"3205503\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-0\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"3205504\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"3205504\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">\"Dengan aplikasi Motorku X memudahkan konsumen dalam berbagai hal. Harapannya program ini memberikan menguntungkan kepada konsumen jadi tidak perlu ke luar rumah dan dapat menghemat waktu juga,\" kata Antofany, Jumat, 30 Juli 2021.</span></div></div></div><div data-key=\"3205507\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-0\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"3205508\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"3205508\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Motorku X memiliki tiga keunggulan, di antaranya mudah yaitu booking service semudah pakai jempol, praktis yaitu tidak perlu antre, seru, yaitu dapatkan fitur games, royalti, dan promo yang menarik. Motorku X juga memiliki fitur-fitur lainnya yakni Refferal Code, kupon KPB Digital, Riwayat Servis, Temukan AHASS hingga Info dan Berita Terbaru.</span></div></div></div><div data-key=\"3205511\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-1\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"3205512\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"3205512\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Aplikasi Motorku X dapat diunduh melalui App Store maupun Play Store. Dengan mengunduh aplikasi Motorku X konsumen tidak perlu ribet lagi jika ingin melakukan servis kendaraan di AHASS. </span></div></div></div><div data-key=\"3205515\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-1\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"3205516\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div class=\"Viewweb__StyledView-sc-1ajfkkc-0 ehNVkT\" style=\"margin: auto; max-width: 624px;\"></div></div><div data-key=\"3205517\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"3205517\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Konsumen bisa melakukan <em data-key=\"3205552\">booking online</em> untuk mencari AHASS terdekat dengan wilayah tempat tinggal anda. Kemudian konsumen juga bisa menentukan tanggal dan jam berapa konsumen ingin datang melakukan servsis. Sangat praktis bukan?</span></div></div></div><div data-key=\"3205523\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-2\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"3205524\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"3205524\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Selain bisa melakukan servis di AHASS, lewat aplikasi ini, Astra Motor Kalbar juga memberikan pelayanan kemudahan lainnya, yakni booking servis online untuk perawatan motor di rumah. Di tengah pandemi saat ini, Astra Motor kalbar menyadari bahwa masyarakat kini mengurangi aktvitasnya di luar. </span></div></div></div><div data-key=\"3205527\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-2\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"3205528\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"3205528\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Kemudian, selain melakukan pembelian langsung ke dealer, konsumen juga bisa melakukan pembelian sepeda motor Honda melalui aplikasi Motorku X. Melalui aplikasi Motorku X, konsumen dapat melihat foto sepeda motor, warna, spesifikasi maka ini tentu akan mempermudah konsumen dalam menentukan pilihan, termasuk diantaranya adalah harga sepeda motor Honda tersebut. </span></div></div></div><div data-key=\"3205531\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-3\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"3205532\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div class=\"Viewweb__StyledView-sc-1ajfkkc-0 ehNVkT\" style=\"margin: auto; max-width: 624px;\"></div></div><div data-key=\"3205533\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"3205533\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Konsumen juga bisa mendapatkan informasi dealer yang dapat memberikan fasilitas untuk mencoba test drive motor tersebut. Sehingga dengan janjian melalui aplikasi ini, maka konsumen mendapatkan kepastian tentang jadwal dan kepastian motor dan dealer tempat ia akan melakukan test ride.</span></div></div></div><div data-key=\"3205536\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-3\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"3205537\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"3205537\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Cara menggunakan aplikasi Motorku X cukup mudah. Pertama, unduh aplikasi Motorku X di gadget Anda dari Play Store maupun App Store. Kemudian register menggunakan nomor handphone, Facebook atau Google Account Anda. Terakhir anda bisa mendaftar nomor mesin Anda. </span></div></div></div><div data-key=\"3205540\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-4\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"3205541\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"3205541\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Setelah register selesai, anda sudah bisa masuk ke halaman aplikasi dan menikmati layanan yang telah disediakan. Dengan mengunduh Motorku X, otomatis kamu sudah mendapatkan point 10, dan mendapatkan point 5 tambahan dari mendaftarkan motor untuk pertama kalinya. Nantinya, Anda juga akan mendapatkan poin-poin lainnya.</span></div></div></div><div data-key=\"3205544\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-4\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"3205545\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div class=\"Viewweb__StyledView-sc-1ajfkkc-0 ehNVkT\" style=\"margin: auto; max-width: 624px;\"></div></div><div data-key=\"3205546\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"3205546\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Praktis banget kan? Yuk, buat kamu yang gak mau ribet, unduh aplikasi Motorku X sekarang dan nikmati promo serta kemudahannya.</span></div></div></div>', 'astra-motor-kalbar-berikan-kemudahan-layanan-dengan-aplikasi-motorku-x', 'kbrt61390424c284e', '2021-09-09 03:15:34', '2021-09-09 03:15:34');
INSERT INTO `berita` VALUES ('brt61396077c76fd', '', '0000-00-00 00:00:00', 'Momen Motor Jupiter Lewati Tebing Tinggi, Netizen: Offroader Kalah Aksi', '<div data-key=\"3018523\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"3018523\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_last_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Para pencinta motor trail pasti sering menjalankan aksinya di jalur tanah dan melawati beragam track yang cukup ekstrem. Tapi, bagaimana jadinya jika motor Jupiter yang justru melewati jalur tersebut? </span></div></div></div><div data-key=\"3018528\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-0\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"3018529\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div class=\"Viewweb__StyledView-sc-1ajfkkc-0 ehNVkT\" style=\"margin: auto; max-width: 624px;\"></div></div><div data-key=\"3018530\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"3018530\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Seperti aksi yang dilakukan oleh 2 pria ini. Lewat unggahan di akun TikTok @trailkabutsalju, terlihat 2 pria mengendari motor Jupiter yang sudah dimodif melewati jalur tanah. Tak tanggung-tanggung, track yang dilaluinya pun terbilang cukup ekstrem. Di mana, mereka memulai aksinya dari atas tebing.</span></div></div></div>', 'momen-motor-jupiter-lewati-tebing-tinggi-netizen-offroader-kalah-aksi', 'kbrt61390424c284e', '2021-09-09 03:16:39', '2021-09-09 03:16:39');
INSERT INTO `berita` VALUES ('brt613960a29a87b', '', '2021-09-18 00:16:00', 'Astra Motor Kalbar Hadirkan Program Cek Motor Gratis', '<div data-key=\"2989593\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"2989593\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_last_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Astra Motor Kalimantan Barat bersama dengan PT Astra Honda Motor memberikan program pengecekan gratis di bengkel Astra Honda Authorized Service Station (AHASS) melalui program ‘Cek Aja Dulu” bagi semua konsumen sepeda motor Honda.</span></div></div></div><div data-key=\"2989598\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-0\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"2989599\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div class=\"Viewweb__StyledView-sc-1ajfkkc-0 ehNVkT\" style=\"margin: auto; max-width: 624px;\"></div></div><div data-key=\"2989600\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"2989600\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Program “Cek Aja Dulu” sebagai bentuk dukungan Astra Motor Kalbar kepada masyarakat dalam memastikan kondisi sepeda motor Honda yang terus prima untuk mendukung mobilitas masyarakat. Program ini dilaksanakan selama periode 17-31 Agustus 2021 di seluruh jaringan AHASS yang tersebar di wilayah Kalbar.</span></div></div></div><div data-key=\"2989603\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-1\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"2989604\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"2989604\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Konsumen bisa mendapatkan layanan pemeriksaan gratis pada layanan oli mesin, busi, pengereman, kelistrikan, suspensi, ban, rantai dan belt. Konsumen akan mendapatkan ceklist rekomendasi dari setiap item pengecekan. Selain mendapatkan pengecekkan gratis, konsumen juga dapat merasakan berbagai fasilitas yang ada di AHASS yakni layanan bebas antri di ride thru/pit express, berbagai promo diskon tematik, serta ruang tunggu yang nyaman. </span></div></div></div><div data-key=\"2989607\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-1\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"2989608\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"2989608\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Khusus untuk pengerjaan servis lengkap+ganti oli di AHASS berkesempatan mendapatkan voucher diskon sebesar 20 peren yang bisa dipakai untuk servis berikutnya. Adapun masa berlaku voucher tersebut sampai dengan 31 Oktober 2021.</span></div></div></div><div data-key=\"2989611\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-2\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"2989612\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div class=\"Viewweb__StyledView-sc-1ajfkkc-0 ehNVkT\" style=\"margin: auto; max-width: 624px;\"></div></div><div data-key=\"2989613\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"2989613\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Technical Service Manager Astra Motor Kalimantan Barat, Iwan Hary Susilo mengatakan, pengecekkan kendaraan sepeda motor merupakan salah satu langkah yang perlu dilakukan pengguna sepeda motor secara rutin dalam mewujudkan keselamatan berkendara seperti slogan berkendara Honda, yakni #Cari_aman. </span></div></div></div>', 'astra-motor-kalbar-hadirkan-program-cek-motor-gratis', 'kbrt61390424c284e', '2021-09-09 03:17:22', '2021-09-09 03:17:22');
INSERT INTO `berita` VALUES ('brt613960eec768e', '', '0000-00-00 00:00:00', 'Astra Motor Kalbar Kenalkan Standarisasi Helm pada Karyawan di Pontianak', '<div data-key=\"3116525\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"3116525\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_last_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Astra Motor Kalimantan Barat memberikan edukasi keselamatan berkendara kepada karyawan CV Bina Sarana Pontianak. Edukasi ini dilaksanakan secara online, mengingat situasi pandemi COVID-19. </span></div></div></div><div data-key=\"3116530\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-0\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"3116531\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div class=\"Viewweb__StyledView-sc-1ajfkkc-0 ehNVkT\" style=\"margin: auto; max-width: 624px;\"></div></div><div data-key=\"3116532\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"3116532\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Edukasi keselamatan berkendara ini diberikan dengan tema mengenal jenis-jenis standarisasi helm yang disampaikan oleh Prastya Agusta, Instruktur Safety Riding Astra Motor Kalimantan Barat. Banyak keseruan didalamnya, dari mulai sesi tanya jawab hingga ujian yang menunjukkan pemahaman peserta tentang \'Cari Aman\' saat berkendara. </span></div></div></div><div data-key=\"3116535\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-1\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"3116536\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"3116536\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Antofany Yusticia Ahmadi, Manager Marketing Astra Motor Kalimantan Barat mengungkapkan, edukasi safety riding ini bertemakan mengenal jenis-jenis standarisasi helm.</span></div></div></div><div data-key=\"3116539\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-2\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"3116540\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"3116540\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">\"Astra Motor Kalimantan Barat memberikan edukasi safety riding kepada peserta edukasi agar mereka Cari Aman, terkait keselamatan berkendara dengan mengenal jenis-jenis standarisasi helm membuat dirinya dan orang lain tetap aman saat berkendara,\" ujarnya, Kamis, 26 Agustus 2021.</span></div></div></div><div data-key=\"3116543\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-3\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"3116544\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"3116544\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Ia menambahkan, edukasi yang diberikan Astra Motor Kalbar merupakan kegiatan rutin yang dilaksanakan guna memberikan pandangan luas terhadap komunitas terkait keselamatan berkendara. </span></div></div></div><div data-key=\"3116547\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-4\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"3116548\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div class=\"Viewweb__StyledView-sc-1ajfkkc-0 ehNVkT\" style=\"margin: auto; max-width: 624px;\"></div></div><div data-key=\"3116549\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"3116549\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">\"Di mana, masih ada yang menganggap menggunakan riding gear membuat gerah, susah bergerak hingga tidak keren. Maka, kita ubah pandangannya bahwa menggunakan riding gear itu aman dan keren,\" tuturnya.</span></div></div></div>', 'astra-motor-kalbar-kenalkan-standarisasi-helm-pada-karyawan-di-pontianak', 'kbrt61390424c284e', '2021-09-09 03:18:38', '2021-09-09 03:18:38');
INSERT INTO `berita` VALUES ('brt61396153146d4', '', '2021-09-18 00:19:00', 'Adakah Virus Alien yang Hidup di Luar Angkasa? Ini Kata Ilmuwan', '<div data-key=\"3157292\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"3157292\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Selain <a href=\"https://kumparan.com/topic/virus\" to=\"https://kumparan.com/topic/virus\" data-key=\"3157295\" class=\"LabelLinkweb__StyledLink-fupmuj-0 kZWIkp components__StyledLink-sc-171r1ki-0 dUURkp\" style=\"cursor: pointer; color: rgb(4, 164, 164); outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0.08);\">virus</a> corona, ada banyak mikroba yang hidup di Bumi. Mereka dapat ditemukan di darat, air, dan udara. Namun, apakah mikroorganisme juga bisa ditemukan di luar Bumi? Jawabannya mungkin saja ada. </span></div></div></div><div data-key=\"3157300\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-0\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"3157301\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div class=\"Viewweb__StyledView-sc-1ajfkkc-0 ehNVkT\" style=\"margin: auto; max-width: 624px;\"></div></div><div data-key=\"3157302\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"3157302\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Seperti yang diungkapkan oleh seorang ilmuwan terkemuka yang mengatakan bahwa virus mematikan seperti SARS-CoV-2 mungkin tidak hanya ditemukan di Bumi, tapi juga di tempat lain di alam semesta.</span></div></div></div><div data-key=\"3157305\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-0\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"3157306\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"3157306\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Ia adalah Prof. Paul Davies, seorang astrobiolog, kosmolog, sekaligus direktur Beyond Center for Fundamental Concepts in Science di Arizona State University. Gagasan adanya virus <a href=\"https://kumparan.com/topic/alien\" to=\"https://kumparan.com/topic/alien\" data-key=\"3157309\" class=\"LabelLinkweb__StyledLink-fupmuj-0 kZWIkp components__StyledLink-sc-171r1ki-0 dUURkp\" style=\"cursor: pointer; color: rgb(4, 164, 164); outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0.08);\">alien </a>didasarkan pada kehidupan mikroba hingga peradaban super maju yang mungkin telah memberi sinyal kepada kita.</span></div></div></div><div data-key=\"3157314\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-1\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"3157315\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"3157315\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Kendati untuk mendukung gagasan tersebut ilmuwan perlu menemukan kehidupan mikroba atau mikroskopis bagaimanapun bentuknya. “Virus merupakan bagian dari jaringan kehidupan,” kata Davies sebagaimana dikutip <em data-key=\"3157385\">The Guardian</em>.</span></div></div></div>', 'adakah-virus-alien-yang-hidup-di-luar-angkasa-ini-kata-ilmuwan', 'kbrt61192748ca296', '2021-09-09 03:20:19', '2021-09-09 03:20:19');
INSERT INTO `berita` VALUES ('brt613961900ec94', '', '2021-10-01 01:25:00', 'Waspada Penipu Pakai Google AdSense untuk Jebak Pengguna OVO', '<div data-key=\"2130073\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"2130073\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_last_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Sebuah upaya <em data-key=\"2130217\">phising</em> alias pengelabuan mengatasnamakan <a href=\"https://kumparan.com/topic/ovo\" to=\"https://kumparan.com/topic/ovo\" data-key=\"2130079\" class=\"LabelLinkweb__StyledLink-fupmuj-0 kZWIkp components__StyledLink-sc-171r1ki-0 dUURkp\" style=\"cursor: pointer; color: rgb(4, 164, 164); outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0.08);\">OVO</a>, muncul di laman pencarian Google. Berdasarkan penelusuran <span data-key=\"2130218\" style=\"font-weight: bolder;\">kumparanTECH</span>, upaya tersebut terlihat ketika kata kunci ‘Call Center OVO’ dimasukkan di mesin pencari <a href=\"https://kumparan.com/topic/google\" to=\"https://kumparan.com/topic/google\" data-key=\"2130087\" class=\"LabelLinkweb__StyledLink-fupmuj-0 kZWIkp components__StyledLink-sc-171r1ki-0 dUURkp\" style=\"cursor: pointer; color: rgb(4, 164, 164); outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0.08);\">Google</a>.</span></div></div></div><div data-key=\"2130092\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-0\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"2130093\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div class=\"Viewweb__StyledView-sc-1ajfkkc-0 ehNVkT\" style=\"margin: auto; max-width: 624px;\"></div></div><div data-key=\"2130094\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"2130094\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Di antara hasil pencarian organik, akan ada iklan penipuan yang mengatasnamakan OVO di hasil pencarian teratas. Iklan-iklan tersebut bervariasi mulai dari link web stabio.cc, cs-ovo.com, cs-ovo.home.blog serta shopInk.to serta nomor <em data-key=\"2130219\">handphone</em> yang bervariasi seperti 08155555121, 0816233164, dan 0816267239.</span></div></div></div><div data-key=\"2130100\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-0\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"2130101\" class=\"components__NormalWidth-l308u-0 components__Inset-l308u-3 kdNaUL ezVOGo\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><figure data-key=\"2130101\" class=\"Helper__StyledFigure-sc-1s2o4g0-6 iVaAoi\" style=\"margin-top: 1.5em; margin-bottom: 1.5em; padding: 0px;\"><div data-key=\"2130102\" class=\"Helper__MediaWrapper-sc-1s2o4g0-7 lbSCKK\" style=\"position: relative; overflow: hidden; margin-bottom: 0px;\"><div class=\"Viewweb__StyledView-sc-1ajfkkc-0 gIZYNi\" style=\"display: flex; align-items: flex-end; -webkit-box-pack: end; justify-content: flex-end; position: relative; cursor: pointer;\"><img width=\"100%\" src=\"https://blue.kumparan.com/image/upload/fl_progressive,fl_lossy,c_fill,q_auto:best,w_640/v1631094166/w1sensbtruvrzllysb8d.png\" alt=\"Waspada Penipu Pakai Google AdSense untuk Jebak Pengguna OVO (1)\" style=\"border-radius: 6px;\"><div class=\"Viewweb__StyledView-sc-1ajfkkc-0 bzCdDt\" style=\"position: absolute;\"><div class=\"Viewweb__StyledView-sc-1ajfkkc-0 jPglPq\" style=\"opacity: 0.5; margin: 10px; border-radius: 6px; width: fit-content; background-color: rgb(0, 0, 0); overflow: hidden;\"><div direction=\"horizontal\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 vucrN Spaceweb__SpacedWrapper-sc-1jr359o-0 lpyBg\" style=\"display: flex; flex-direction: row; -webkit-box-align: center; align-items: center; -webkit-box-pack: center; justify-content: center; padding: 4px 8px;\"><img name=\"search icon\" data-qa-id=\"search\" src=\"https://blue.kumparan.com/uikit-assets/assets/icons/search-c4f6b18b1ae61a21f36e262683d44750.svg\" alt=\"search\" class=\"Iconweb__StyledIcon-zyhgsp-0 kDzZYm\" style=\"filter: invert(100%) sepia(0%) saturate(1534%) hue-rotate(43deg) brightness(114%) contrast(100%); width: 12px; max-width: 12px; height: 12px; margin-right: 4px; border-radius: 6px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 dDNucl\" style=\"-webkit-font-smoothing: antialiased; color: rgb(255, 255, 255); font-size: 12px; line-height: 16px; margin-right: 0px;\">Perbesar</span></div></div></div></div></div><figcaption data-key=\"2130105\" class=\"Helper__MediaCaption-sc-1s2o4g0-9 exJAai\" style=\"width: 624px; -webkit-font-smoothing: antialiased; color: rgb(153, 153, 153); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 1.4rem; padding: 10px 0px; margin: 0px; position: relative;\">Penipuan call center OVO dari iklan Google. Foto: Screenshot</figcaption></figure></div><div data-key=\"2130108\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"2130108\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Padahal menurut informasi resmi, OVO hanya memiliki satu situs resmi ovo yakni www.ovo.id.co.id/. Sementara itu, nomor telepon resmi juga hanya ada di call center (pusat layanan) 1500696 untuk pengguna dan 1500167 untuk <em data-key=\"2130220\">merchant</em>.</span></div></div></div><div data-key=\"2130114\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-1\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"2130115\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"2130115\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Mengenai hal ini, OVO langsung angkat bicara bahwa keamanan dan data pengguna merupakan hal yang sangat penting dan menjadi prioritas perusahaan. </span></div></div></div><div data-key=\"2130118\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-1\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"2130119\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"2130119\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">\"Sehubungan dengan maraknya upaya phising atau social engineering yang mengatasnamakan OVO, kami secara resmi menyatakan bahwa OVO hanya memiliki satu situs perusahaan resmi yaitu www.ovo.id,\" kata Harumi Supit, Head of Corporate Communications, OVO lewat keterangan resmi yang diterima <span data-key=\"2130221\" style=\"font-weight: bolder;\">kumparanTECH</span>, (8/9).</span></div></div></div>', 'waspada-penipu-pakai-google-adsense-untuk-jebak-pengguna-ovo', 'kbrt61192748ca296', '2021-09-09 03:21:20', '2021-09-09 03:21:20');
INSERT INTO `berita` VALUES ('brt613962403c203', '', '2021-09-16 00:23:00', 'Viral HP Nokia Jadul Nyangkut di Perut Pasien, Kok Bisa?', '<div data-key=\"2917257\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"2917257\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Seorang dokter asal Kosovo bernama Skender Telaku kaget bukan kepalang saat mengoperasi seorang pasien pada pekan lalu. Entah bagaimana, ia menemukan sebuah <a href=\"https://kumparan.com/topic/hp\" to=\"https://kumparan.com/topic/hp\" data-key=\"2917260\" class=\"LabelLinkweb__StyledLink-fupmuj-0 kZWIkp components__StyledLink-sc-171r1ki-0 dUURkp\" style=\"cursor: pointer; color: rgb(4, 164, 164); outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0.08);\">HP</a> Nokia jadul bersarang di perut sang pasien.</span></div></div></div><div data-key=\"2917265\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-0\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"2917266\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div class=\"Viewweb__StyledView-sc-1ajfkkc-0 ehNVkT\" style=\"margin: auto; max-width: 624px;\"></div></div><div data-key=\"2917267\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"2917267\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Kisah ini bermula ketika sang pasien, seorang pria berumur 33 tahun yang tidak disebutkan identitasnya, datang ke rumah sakit Qendra Klinike Universitare e Kosovës (QKUK) di kota Pristina, Kosovo pada akhir Agustus 2021. Pasien tersebut mengeluhkan <a href=\"https://kumparan.com/topic/sakit-perut\" to=\"https://kumparan.com/topic/sakit-perut\" data-key=\"2917270\" class=\"LabelLinkweb__StyledLink-fupmuj-0 kZWIkp components__StyledLink-sc-171r1ki-0 dUURkp\" style=\"cursor: pointer; color: rgb(4, 164, 164); outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0.08);\">sakit perut</a> selama 4 hari. </span></div></div></div><div data-key=\"2917275\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-0\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"2917276\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"2917276\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Tim dokter pun kemudian memindai tubuh sang pasien dengan X-ray dan menemukan objek aneh di perutnya. Saat menyelidiki lebih lanjut lewat kamera endoskopi, objek tersebut ternyata sebuah HP Nokia 3310 — seri ponsel legendaris dari Nokia yang pertama kali dirilis 21 tahun lalu dan versi <em data-key=\"2917337\">reborn</em>-nya muncul pada 2017.</span></div></div></div><div data-key=\"2917282\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-1\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"2917283\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"2917283\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Untungnya, HP Nokia berwarna merah itu dapat dikeluarkan dari perut sang pasien tanpa perlu operasi. “Melalui cara endoskopik, jadi tanpa memotong perut, kami menarik ponsel yang terbelah menjadi tiga bagian. Tidak ada komplikasi,” kata Telaku dalam <em data-key=\"2917338\">posting</em>-nya di Facebook yang jadi viral pada 31 Agustus 2021.</span></div></div></div><div data-key=\"2917289\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-1\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"2917290\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div class=\"Viewweb__StyledView-sc-1ajfkkc-0 ehNVkT\" style=\"margin: auto; max-width: 624px;\"></div></div><div data-key=\"2917291\" class=\"components__NormalWidth-l308u-0 components__Inset-l308u-3 kdNaUL ezVOGo\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"2917291\" class=\"MediaHelper__MediaWrapper-sc-1wg3qq9-0 eWLkqI\" style=\"padding: 0px; margin: 0px; overflow: hidden;\"><div class=\"FacebookOembedView__Wrapper-k23qw1-0 kBQXoK\" style=\"margin-bottom: 1em;\"><div class=\"FacebookOembedView__OEmbedWrapper-k23qw1-3 krcriB\"><span style=\"font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px;\">HP Nokia tersebut ada di perut sang pasien usai dirinya menelan ponsel bulat-bulat, membuatnya sakit. Hingga saat ini, tidak jelas mengapa dan bagaimana bisa ia menelan HP tersebut.</span><br></div></div></div></div><div data-key=\"2917297\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-2\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"2917298\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"2917298\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Kepada media lokal Ekspres, Telaku menyebut bahwa baterai adalah bagian paling berbahaya dari HP karena dapat meledak dan melepaskan bahan kimia ke dalam usus sang pasien, sehingga nyawanya berpotensi dalam bahaya. Pasien kini dalam kondisi yang baik, kata Telaku kepada media lokal tersebut.</span></div></div></div>', 'viral-hp-nokia-jadul-nyangkut-di-perut-pasien-kok-bisa', 'kbrt61192748ca296', '2021-09-09 03:24:16', '2021-09-09 03:24:16');
INSERT INTO `berita` VALUES ('brt6139627a52ecb', '', '2022-02-09 08:24:00', 'Zoom Dilaporkan Down Hari Ini untuk Sebagian Pengguna', '<div data-key=\"23536\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"23536\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Aplikasi video <em data-key=\"23623\">conference</em> <a href=\"https://kumparan.com/topic/zoom\" to=\"https://kumparan.com/topic/zoom\" data-key=\"23542\" class=\"LabelLinkweb__StyledLink-fupmuj-0 kZWIkp components__StyledLink-sc-171r1ki-0 dUURkp\" style=\"cursor: pointer; color: rgb(4, 164, 164); outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0.08);\">Zoom</a> dilaporkan <em data-key=\"23624\">down</em> oleh sebagian pengguna pada hari ini, Rabu (8/9). Pengguna yang terdampak umumnya mengeluh bahwa mereka kesulitan untuk masuk ke ruangan <em data-key=\"23625\">meeting</em> virtual.</span></div></div></div><div data-key=\"23553\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-0\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"23554\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div class=\"Viewweb__StyledView-sc-1ajfkkc-0 ehNVkT\" style=\"margin: auto; max-width: 624px;\"></div></div><div data-key=\"23555\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"23555\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Berdasarkan pantauan situs DownDetector, <a href=\"https://kumparan.com/topic/aplikasi\" to=\"https://kumparan.com/topic/aplikasi\" data-key=\"23558\" class=\"LabelLinkweb__StyledLink-fupmuj-0 kZWIkp components__StyledLink-sc-171r1ki-0 dUURkp\" style=\"cursor: pointer; color: rgb(4, 164, 164); outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0.08);\">aplikasi</a> Zoom memang tercatat mengalami gangguan sejak pagi. Laporan Zoom <em data-key=\"23626\">down</em> meningkat mulai pukul 08.00 WIB dengan tren gangguan yang fluktuatif sampai sore hari.</span></div></div></div><div data-key=\"23566\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-1\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"23567\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"23567\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">DownDetector mencatat bahwa laporan Zoom <em data-key=\"23627\">down</em> mencapai puncaknya pada pukul 10.27, 13.27, dan 14.27 WIB. Situs tersebut juga menunjukkan bahwa 44 persen pengguna melaporkan masalah koneksi server, 32 persen mengeluh sulit masuk ke konferensi, dan 24 persen enggak bisa <em data-key=\"23628\">login</em>.</span></div></div></div>', 'zoom-dilaporkan-down-hari-ini-untuk-sebagian-pengguna', 'kbrt61192748ca296', '2021-09-09 03:25:14', '2021-09-09 03:25:14');
INSERT INTO `berita` VALUES ('brt613962a34d5d1', '', '2022-02-09 08:30:00', 'Pengguna WhatsApp Bakal Bisa Sembunyikan Status Last Seen untuk Kontak Tertentu', '<div data-key=\"3231036\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"3231036\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\"><a href=\"https://kumparan.com/topic/whatsapp\" to=\"https://kumparan.com/topic/whatsapp\" data-key=\"3231039\" class=\"LabelLinkweb__StyledLink-fupmuj-0 kZWIkp components__StyledLink-sc-171r1ki-0 dUURkp\" style=\"cursor: pointer; color: rgb(4, 164, 164); outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0.08);\">WhatsApp</a> kembali meningkatkan fitur privasinya agar para pengguna merasa nyaman menggunakan platform mereka. Hal yang baru adalah pengguna WhatsApp bakal leluasa menyembunyikan status \"Last Seen\" (terakhir dilihat) untuk <a href=\"https://kumparan.com/topic/kontak\" to=\"https://kumparan.com/topic/kontak\" data-key=\"3231044\" class=\"LabelLinkweb__StyledLink-fupmuj-0 kZWIkp components__StyledLink-sc-171r1ki-0 dUURkp\" style=\"cursor: pointer; color: rgb(4, 164, 164); outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0.08);\">kontak</a> tertentu saja.</span></div></div></div><div data-key=\"3231049\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-0\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"3231050\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div class=\"Viewweb__StyledView-sc-1ajfkkc-0 ehNVkT\" style=\"margin: auto; max-width: 624px;\"></div></div><div data-key=\"3231051\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"3231051\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Tidak hanya status Last Seen, nantinya opsi kontak tertentu juga hadir untuk pengaturan <a href=\"https://kumparan.com/topic/privasi\" to=\"https://kumparan.com/topic/privasi\" data-key=\"3231054\" class=\"LabelLinkweb__StyledLink-fupmuj-0 kZWIkp components__StyledLink-sc-171r1ki-0 dUURkp\" style=\"cursor: pointer; color: rgb(4, 164, 164); outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0.08);\">privasi</a> foto profil dan bio pengguna Whatsapp. Jika kamu mengaktifkan pilihan tersebut, hanya kontak tertentu saja yang tidak bisa lihat status Last Seen, foto profil dan bio.</span></div></div></div><div data-key=\"3231059\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-1\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"3231060\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"3231060\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Saat ini, pengguna WhatsApp hanya disediakan pilihan untuk pengaturan status Last Seen kasih lihat semua orang, hanya ke kontak, dan sembunyikan ke siapa pun. Dengan adanya penambahan opsi baru ini, pengguna bisa memilih untuk menyembunyikan status ke beberapa kontak pilihan yang dikehendaki. Hal ini juga berlaku untuk foto profil dan bio.</span></div></div></div><div data-key=\"3231063\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-2\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"3231064\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"3231064\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Fitur privasi baru ini akan segera meluncur untuk pengguna WhatsApp versi Android dan iOS. Menurut laporan <em data-key=\"3231095\">WABetaInfo</em>, WhatsApp masih melakukan pengujian dan belum membagikan fitur baru ini untuk seluruh pengguna.</span></div></div></div>', 'pengguna-whatsapp-bakal-bisa-sembunyikan-status-last-seen-untuk-kontak-tertentu', 'kbrt61192748ca296', '2021-09-09 03:25:55', '2021-09-09 03:25:55');
INSERT INTO `berita` VALUES ('brt613962c6d7dc4', '', '2021-11-27 00:30:00', 'Ilmuwan Peringatkan Badai Matahari Bisa Picu Kiamat Internet, Kok Bisa?', '<div data-key=\"3231352\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"3231352\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_last_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Pad dasarnya, <a href=\"https://kumparan.com/topic/matahari\" to=\"https://kumparan.com/topic/matahari\" data-key=\"3231355\" class=\"LabelLinkweb__StyledLink-fupmuj-0 kZWIkp components__StyledLink-sc-171r1ki-0 dUURkp\" style=\"cursor: pointer; color: rgb(4, 164, 164); outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0.08);\">Matahari </a>akan selalu menghujani Bumi dengan kabut partikel magnet yang dikenal sebagai angin Matahari. Sebagian besar perisai magnet Bumi menghalangi angin matahari ini untuk mencegah kerusakan di Bumi.</span></div></div></div><div data-key=\"3231360\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-0\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"3231361\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div class=\"Viewweb__StyledView-sc-1ajfkkc-0 ehNVkT\" style=\"margin: auto; max-width: 624px;\"></div></div><div data-key=\"3231362\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"3231362\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Namun terkadang, setiap satu abad sekali, intensitas angin matahari meningkat menjadi <a href=\"https://kumparan.com/topic/badai\" to=\"https://kumparan.com/topic/badai\" data-key=\"3231365\" class=\"LabelLinkweb__StyledLink-fupmuj-0 kZWIkp components__StyledLink-sc-171r1ki-0 dUURkp\" style=\"cursor: pointer; color: rgb(4, 164, 164); outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0.08);\">badai </a>Matahari besar. Kabar buruknya, menurut penelitian baru di konferensi komunikasi data SIGCOMM 2021, cuaca luar angkasa yang ekstrem seperti badai Matahari bisa menjadi bencana besar bagi kehidupan modern di Bumi.</span></div></div></div><div data-key=\"3231370\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-0\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"3231371\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"3231371\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Singkatnya, dikatakan oleh Sangeetha Abdu Jyothi, asisten profesor di University of California, Irvine, badai Matahari ekstrem bisa menyebabkan kiamat <a href=\"https://kumparan.com/topic/internet\" to=\"https://kumparan.com/topic/internet\" data-key=\"3231374\" class=\"LabelLinkweb__StyledLink-fupmuj-0 kZWIkp components__StyledLink-sc-171r1ki-0 dUURkp\" style=\"cursor: pointer; color: rgb(4, 164, 164); outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0.08);\">internet</a> sehingga sebagian besar masyarakat dunia tidak bisa mengakses layanan internet dalam waktu yang cukup lama, berminggu-minggu sampai berbulan-bulan.</span></div></div></div><div data-key=\"3231379\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-1\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"3231380\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"3231380\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">\"Yang benar-benar membuat saya berpikir tentang ini adalah bahwa dengan pandemi, kita melihat betapa tidak siapnya dunia. Tidak ada protokol untuk menanganinya secara efektif, dan itu sama dengan ketahanan internet,\" kata Abdu Jyothi kepada <em data-key=\"3231456\">WIRED</em>. \"Infrastruktur kami tidak siap untuk peristiwa matahari skala besar.\"</span></div></div></div>', 'ilmuwan-peringatkan-badai-matahari-bisa-picu-kiamat-internet-kok-bisa', 'kbrt61192748ca296', '2021-09-09 03:26:30', '2021-09-09 03:26:30');
INSERT INTO `berita` VALUES ('brt613962eccde97', '', '2021-11-24 01:36:00', 'Tak Main-main, China Pakai Nuklir untuk Lawan Nyamuk', '<div data-key=\"1558022\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"1558022\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_last_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\"><a href=\"https://kumparan.com/topic/nyamuk\" to=\"https://kumparan.com/topic/nyamuk\" data-key=\"1558025\" class=\"LabelLinkweb__StyledLink-fupmuj-0 kZWIkp components__StyledLink-sc-171r1ki-0 dUURkp\" style=\"cursor: pointer; color: rgb(4, 164, 164); outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0.08);\">Nyamuk</a> adalah salah satu hewan penyebar penyakit. Dan China tampaknya enggak mau setengah-setengah untuk melawan serangga tersebut.</span></div></div></div><div data-key=\"1558030\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-0\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"1558031\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div class=\"Viewweb__StyledView-sc-1ajfkkc-0 ehNVkT\" style=\"margin: auto; max-width: 624px;\"></div></div><div data-key=\"1558032\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"1558032\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Media pemerintah China, <em data-key=\"1558105\">Global Times</em>, melaporkan bahwa para peneliti di Nuclear Technology Research and Development Center of the China Atomic Energy Authority (CAEA) telah mengembangkan teknologi <a href=\"https://kumparan.com/topic/nuklir-chernobyl\" to=\"https://kumparan.com/topic/nuklir-chernobyl\" data-key=\"1558038\" class=\"LabelLinkweb__StyledLink-fupmuj-0 kZWIkp components__StyledLink-sc-171r1ki-0 dUURkp\" style=\"cursor: pointer; color: rgb(4, 164, 164); outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0.08);\">nuklir</a> untuk memberantas nyamuk.</span></div></div></div><div data-key=\"1558043\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-0\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"1558044\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"1558044\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Teknologi ini, yang dikenal sebagai nuclear sterile insect technique (SIT), diklaim dapat mengurangi nyamuk sekaligus penyakit mematikan yang disebabkan oleh hewan tersebut.</span></div></div></div><div data-key=\"1558047\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-qa-id=\"story-page-1\"></div><div class=\"sc-5mlv5q-0 hZqCOq\" style=\"width: 624px;\"></div></div><div data-key=\"1558048\" class=\"components__NormalWidth-l308u-0 kdNaUL\" style=\"position: relative; margin: 0px auto; max-width: 62.4rem; padding: 0px; color: rgb(0, 0, 0); font-family: Heebo, sans-serif; font-size: 14px; white-space: pre-wrap;\"><div data-key=\"1558048\" class=\"Viewweb__StyledView-sc-1ajfkkc-0 bvuAuC track_paragraph\" style=\"margin-top: 15px; margin-bottom: 15px;\"><div class=\"TextBoxweb__StyledTextBox-sc-18x3wcq-0 bKesRR\" style=\"line-height: 14px;\"><span class=\"Textweb__StyledText-sc-1uxddwr-0 lmbERM\" style=\"-webkit-font-smoothing: antialiased; font-family: &quot;PT Serif&quot;, Georgia, serif; font-size: 20px; line-height: 30px;\">Teknologi nuklir pemberantas nyamuk ini menggunakan radiasi untuk memadamkan kapasitas reproduksi nyamuk jantan. Setelah dilepaskan, nyamuk jantan yang sudah mandul akan kawin dengan betina liar tanpa menghasilkan keturunan.</span></div></div></div>', 'tak-main-main-china-pakai-nuklir-untuk-lawan-nyamuk', 'kbrt61192748ca296', '2021-09-09 03:27:08', '2021-09-09 03:27:08');

